import React, { useState, useEffect } from 'react';
import { observer } from 'mobx-react';
import { ConfigProvider, Checkbox } from 'antd';
import EasyForm from '@appen/easy-form';
import { Field } from '@appen/easy-form/es/types';
import OCRForm from './OCRForm';
import FormulaForm from './FormulaForm';
import InstanceItem from '../../model/InstanceItem';
import store from '../../store/RootStore';
import i18n from '../../locales';
import { setInitialValues, getSnapshot } from '../../utils';
import './AttributesModal.scss';

interface InstanceItemAttributesFormProps {
  instanceItem: InstanceItem;
  onSubmit: (values: { attributes?: any; OCRText?: string; formulaText?: string }, applyAll: boolean) => void;
}

const InstanceItemAttributesForm = observer(({ instanceItem, onSubmit }: InstanceItemAttributesFormProps) => {
  // FIXME: use current camera cause multiple cameras not supported yet
  const { currentCamera, currentFrame, isSingleCamera, cameraNames } = store.frame;
  const frameData = instanceItem.cameras[currentCamera].frames[currentFrame];
  const { labelConfig: config } = instanceItem.categoryItemRef;

  // ocr snapshot
  const [snapshot, setSnapshot] = useState('');
  // ocr text or formula text
  const [text, setText] = useState('');
  // apply all
  const [applyAll, setApplyAll] = useState(false);
  // fields
  const [fields, setFields] = useState<Field[]>([]);

  // set initial ocr text
  useEffect(() => {
    if (frameData?.isOCR || frameData?.isFormula) {
      // get snapshot
      const getCurrentSnapshot = async () => {
        try {
          const url = await getSnapshot(store.frame.frames[currentFrame], frameData?.shape);
          setSnapshot(url);
        } catch (e) {
          setSnapshot('');
        }
      };
      getCurrentSnapshot();
    }
    if (frameData?.isOCR) {
      setText(frameData?.OCRText || '');
    } else if (frameData?.isFormula) {
      setText(frameData?.formulaText || '');
    }
    setFields(setInitialValues(config?.fields || [], frameData?.attributes));
  }, []);

  const handleSubmit = (attributes?: any) => {
    const allValues: { attributes?: any; OCRText?: string; formulaText?: string } = { attributes };
    if (frameData.isOCR) {
      allValues.OCRText = text;
    } else if (frameData.isFormula) {
      allValues.formulaText = text;
    }
    onSubmit(allValues, applyAll);
  };

  if (!store.instance.isInstanceItemAttributesEnabled(instanceItem)) {
    return null;
  }

  return (
    <div className="attributes-form-section">
      <div className="attributes-form-section__title">
        {`${instanceItem.itemLabel}${isSingleCamera ? '' : `-C${cameraNames.indexOf(currentCamera) + 1}`}`}
        {store.frame.frameCount > 1 && (
          <ConfigProvider prefixCls="easyform">
            <Checkbox checked={applyAll} onChange={(e) => setApplyAll(e.target.checked)}>
              {i18n.translate('APPLY_TO_FOLLOWING_FRAMES')}
            </Checkbox>
          </ConfigProvider>
        )}
      </div>
      {(frameData.isOCR || frameData.isFormula) && (
        <div
          className="ocr-snapshot"
          style={{
            backgroundImage: `url(${snapshot})`,
            height: 72,
            marginBottom: 16,
          }}
        />
      )}
      <div className="attributes-form-section__content">
        {frameData.isOCR && (
          <div className="attributes-form-section__item">
            <OCRForm
              snapshot={snapshot}
              text={text}
              onTextChange={setText}
            />
          </div>
        )}
        {config && (
          <div className="attributes-form-section__item">
            <EasyForm
              theme="dark"
              fields={fields}
              conditions={config.conditions}
              effects={config.effects}
              rules={config.rules}
              onSubmit={(v) => handleSubmit(v)}
            />
          </div>
        )}
        {frameData.isFormula && !frameData.isOCR && (
          <div className="attributes-form-section__item">
            <FormulaForm
              text={text}
              onTextChange={setText}
            />
          </div>
        )}
      </div>
      {!config && (
        <div style={{ display: 'none' }}>
          {/* eslint-disable-next-line jsx-a11y/control-has-associated-label */}
          <button className="easyform-btn form-btn-submit" onClick={() => handleSubmit()} />
        </div>
      )}
    </div>
  );
});

export default InstanceItemAttributesForm;
